import React from 'react';
import { Box, Container, Button, Grid, Paper } from '@mui/material';
import { makeStyles } from '@material-ui/core';

import Hero from '../../Hero/Hero';
import Footer from '../../Footer/Footer';

const useStyles = makeStyles((theme) => ({
  textContent: {
    alignSelf: 'center',
    marginTop: '0px',
    paddingLeft: theme.spacing(5),
  },
  card: {
    backgroundColor: '#999',
    margin: '15px 15px 0px 15px',
    textAlign: 'center',
  },
}));

const Projects = (props) => {
  const classes = useStyles();

  const heading = 'Projects';
  const caption = 'This is my Projects';
  const image =
    'https://images.pexels.com/photos/372787/pexels-photo-372787.jpeg?cs=srgb&dl=pexels-pixabay-372787.jpg&fm=jpg';
  const btnLeft = 'Education';
  const btnRight = 'Contact';
  return (
    <Box>
      <Hero
        heading={heading}
        caption={caption}
        image={image}
        btnLeft={btnLeft}
        btnRight={btnRight}
      />
      <Paper className={classes.card} elevation={3}>
        <Grid container xs={12}>
          <Grid item xs={6}>
            <h1> BMI Calculator</h1>
          </Grid>
          <Grid item xs={6}>
            <Button className={classes.textContent} variant="contained">
              View
            </Button>
          </Grid>
        </Grid>
      </Paper>
      <Footer />
    </Box>
  );
};

export default Projects;
